function SelectPhoto(){this.initEvent()}SelectPhoto.prototype.validateTypeFile=function(o){return!!/^(?:image\/jpeg|image\/png)$/i.test(o.type)},SelectPhoto.prototype.initEvent=function(){$("input[name='file-input-photo']").on("change",function(){if(!window.photoevent.selectPhoto.validateTypeFile($("#file-input-photo").get(0).files[0])){window.photoevent.dialog.error("Erro","O arquivo deve possuir o formato jpeg ou png.");var o=$("#file-input-photo");return void o.replaceWith(o.val("").clone(!0))}$("#form-send-photo").submit()}),$("#download-button").click(function(o){o.preventDefault(),$("#file-input-photo").click()})},window.photoevent=window.photoevent||{},window.photoevent.selectPhoto=window.photoevent.selectPhoto||new SelectPhoto;